				)}
				{!isAdmin && (
					<Button onClick={() => handleOpenLink(PRICING_LINK)} role='link'>
						{t('Learn_more')}
					</Button>
				)}
			</StatesActions>
		</States>
	);
};

export default PrivateEmptyStateUpgrade;
